const uniqueArray = arr => { 
  const seen = {}; 
  const output = []; 

  for (let i = 0; i < arr.length; i++) { 
    if (!seen[arr[i]]) { 
      seen[arr[i]] = true; 
      output.push(arr[i]); 
    } 
  } 
  return output; 
} 

console.log (uniqueArray([1, 2, 3, 2, 4, 5, 6, 7, 1, 4])); 
// Output: [1, 2, 3, 4, 5, 6, 7]
